function TodoForm() {
    return (
        <form>
        <label>Escribe tu nuevo TODO</label>
        <textarea
        placeholder="cortar cebolla para el almuerzo"
        />
        <button
            className="TodoForm-button TodoForm-button--cancel"
        ></button>
        <button
            className="TodoForm-button TodoForm-button--add"
        ></button>
        </form>
    );
    }

export { TodoForm };
